prompt Importing table SMS_ATT_CONFIG...
set feedback off
set define off
-- Create table
create table SMS_ATT_CONFIG
(
  id             VARCHAR2(36) default sys_guid(),
  code           VARCHAR2(100) not null,
  name           VARCHAR2(300),
  type           VARCHAR2(36) not null,
  att_value      VARCHAR2(3000),
  null_able      VARCHAR2(1) not null,
  att_default    VARCHAR2(300),
  att_comment    VARCHAR2(100),
  belong_type    VARCHAR2(2),
  belong_id      VARCHAR2(36),
  create_date    DATE,
  create_user_id VARCHAR2(36),
  update_date    DATE,
  update_user_id VARCHAR2(36)
)
tablespace FINANCE_DATA
  pctfree 10
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
-- Add comments to the columns 
comment on column SMS_ATT_CONFIG.id
  is '属性配置ID';
comment on column SMS_ATT_CONFIG.code
  is '属性编码';
comment on column SMS_ATT_CONFIG.name
  is '属性名称';
comment on column SMS_ATT_CONFIG.type
  is '属性类型';
comment on column SMS_ATT_CONFIG.att_value
  is '属性值';
comment on column SMS_ATT_CONFIG.null_able
  is '可否为空';
comment on column SMS_ATT_CONFIG.att_default
  is '默认值';
comment on column SMS_ATT_CONFIG.att_comment
  is '备注';
comment on column SMS_ATT_CONFIG.belong_type
  is '所属类型';
comment on column SMS_ATT_CONFIG.belong_id
  is '所属ID';
comment on column SMS_ATT_CONFIG.create_date
  is '创建时间';
comment on column SMS_ATT_CONFIG.create_user_id
  is '创建用户ID';
comment on column SMS_ATT_CONFIG.update_date
  is '更新时间';
comment on column SMS_ATT_CONFIG.update_user_id
  is '更新用户ID';

